BEGIN TRANSACTION;
CREATE TABLE player_states (
            id          integer primary key autoincrement,
            player_id   integer     null,
            team_states_id integer   null,
            team_id     integer     null,
            jersey_no   integer     null,
            position    varchar(3)  null,
            start_date  date        null,
            end_date    date        null,
            FOREIGN KEY(player_id) REFERENCES players(id),
            FOREIGN KEY(team_states_id) REFERENCES team_states(id),
            FOREIGN KEY(team_id) REFERENCES teams(id)
        );
CREATE TABLE players (
            id         integer primary key autoincrement,
            first_name varchar(35) null,
            last_name  varchar(35) null,
            city       varchar(30) null,
            territory  varchar(30) null,
            country    varchar(30) null,
            birthdate  date        null,
            br_id TEXT(8), full_name VARCHAR(50), suffix VARCHAR(5), year_start CHAR(4), year_end CHAR(4), position varCHAR(5), height_str varCHAR(4), height_in INTEGER, weight INTEGER, birth_date Date, colleges JSON);
CREATE TABLE seasons(  
    id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    season_start date null,
    season_end date null,
    league CHAR(3) null,
    champion INTEGER  NULL,
    mvp INTEGER  NULL,
    roy INTEGER  NULL,
    scoring_leader INTEGER NULL,
    rebounds_leader INTEGER NULL,
    assists_leader INTEGER NULL,
    win_shares_leader INTEGER NULL, br_id CHARACTER(8), active CHAR(8) default null, champion_br_id CHARACTER(20), mvp_br_id CHARACTER(20), roy_br_id CHARACTER(20), scoring_leader_br_id CHARACTER(20), rebounding_leader_br_id CHARACTER(20), assists_leader_br_id CHARACTER(20), winshares_leader_br_id CHARACTER(20), scoring_leader_points INT,

    Foreign Key (champion) REFERENCES teams(id)
    Foreign Key (mvp) REFERENCES players(id)
    Foreign Key (roy) REFERENCES players(id)
    Foreign Key (scoring_leader) REFERENCES players(id)
    Foreign Key (rebounds_leader) REFERENCES players(id)
    Foreign Key (assists_leader) REFERENCES players(id)
    Foreign Key (win_shares_leader) REFERENCES players(id)

    
);
CREATE TABLE team_states (
            id          integer primary key autoincrement,
            team_id     integer     null,
            city        varchar(30) null,
            territory   varchar(30) null,
            zip         varchar(10) null,
            country     varchar(30) null,
            start_date  date        null,
            end_date    date        null,
            FOREIGN KEY(team_id) REFERENCES teams(id)
        );
CREATE TABLE teams (
            id   integer primary key autoincrement,
            name varchar(50) null
        , br_id TEXT(3), nba TINYINT, baa TINYINT, aba TINYINT, season_start CHARACTER(4), season_end CHARACTER(4), location VARCHAR(30));
DELETE FROM "sqlite_sequence";
COMMIT;
